export default function Contact() {
  return (
    <section className="max-w-2xl mx-auto py-20 px-4">
      <h2 className="text-3xl font-bold mb-6">Contact Me</h2>
      <p className="text-gray-700 mb-4">
        I'm currently open to freelance opportunities or full-time roles. Feel free to reach out!
      </p>
      <a
        href="mailto:your@email.com"
        className="inline-block mt-4 px-6 py-3 bg-black text-white rounded hover:bg-gray-800 transition"
      >
        Send an Email
      </a>
    </section>
  );
}
